script: |
  super -f text -I q4853.spq | sort > q4853.out

inputs:
  - name: q4853.spq
    data: |
      SELECT - ( + - 32 ) * + col2 * - col0 + + col0 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( + col0 ) + - col1 * - 71 + - 32 IN ( + col0 + - col0, - ( - - 83 ) );
  - name: tab1

outputs:
  - name: q4853.out
    data: |
      -156621
      -160395
      -197925
